import React from 'react';
import { List, Card, Row, Col } from 'antd';

// Mock movie data
const movieData = [
  { id: 1, title: 'Movie 1' },
  { id: 2, title: 'Movie 2' },
  { id: 3, title: 'Movie 3' },
  { id: 4, title: 'Movie 4' },
  { id: 5, title: 'Movie 5' },
  { id: 6, title: 'Movie 6' },
];
function ListComponent() {
    return (
      <div style={{ padding: '20px' }}>
        <Row gutter={16}>
          <List
            grid={{ gutter: 16, column: 3 }}
            dataSource={movieData}
            renderItem={(item) => (
              <List.Item>
                <Card title={item.title} style={{ width: '100%' }}>
                  <p>Movie ID: {item.id}</p>
                  {/* Add more movie details here if needed */}
                </Card>
              </List.Item>
            )}
          />
        </Row>
      </div>
    );
  }

  export default ListComponent;
